import React from 'react';
import '../styles/list-poll.css';

class ListPoll extends React.Component {

	render() {

		const { DB } = this.props;

		return <section id="listPollView">

			{
				DB.GetUserPolls().then(result => {

					let html = `<div>Мои опросы:</div>`

					forEach(result, (row, index) => {
						html += PollElem(row, index);
					})

					$jsf(`#listPollView`).appendChild(html);
				})
			}

		</section>
	}
}
export { ListPoll };
